import React from "react";

function Plastics() {
  return (
    <div style={{ padding: 20 }}>
      <h1>Plastics</h1>
      <p>
        Plastics can be recycled depending on the type. Common recyclable plastics include PET bottles (bottiglia PET), HDPE containers, and jugs. Always check local recycling guidelines.
      </p>
      <ul>
        <li>Rinse containers before recycling</li>
        <li>Remove caps if required by your municipality</li>
        <li>Do not include plastic bags in curbside recycling</li>
      </ul>
    </div>
  );
}

export default Plastics;
